// import { Card } from "react-bootstrap";
import "./Cards.css";

const Cards = () => {
  return (
    <div>
      <div className="cards">
         <div className="cards__inside-card"> 
         <Card >
                <Card.Body>
                  <div className="cards__icon">
                    <i className="bi bi-bar-chart-fill"></i>
                  </div>
                  <h2>714K</h2>
                  <p>Total Data</p>
                </Card.Body>
              </Card>
         </div>
        {/* <div className="row">
          <div className="col-lg-12">
            <div className="col-lg-3">

            </div> */}


          </div>
        </div>
  );
};

export default Cards;
